    {
        path: '/',
        element: <TaskManagerPage/>,
        children: [
            { index: true, element:<div>Signup</div> },
            {
                path: 'signup',
                element: <Header/>
            },
            {
                path: 'signin',
                element: <div>Signin</div>
            }
        ]
    }
])
const App = () => {

    return (
        <RouterProvider router={router}>
            {/* <Header />
